$black: #080808;
$white: #f9f9f9;
$lightgray: rgba(255, 255, 255, .1);
$darkgray: rgba(0, 0, 0, .8);

@mixin after-black {
    content: "";
    position: absolute;
    right: 0;
    top: 0px;
    width: 100%;
    height: 100%;
    background: #080808;
}

